import React, {Component} from 'react';
import './App.css'
import LoginInfo from "./components/loginInfo";

class App extends Component {
    render() {
        return (
            <div>
                <img src={[require("./components/logo/logo.png")]} alt="logo" className="logo"/>
                <LoginInfo/>

            </div>
        );
    }
}

export default App;
